<p>This is my db :</p>
<pre><code>db={
  &quot;fridges&quot;: [
    {
      _id: 1,
      items: [
        {
          itemId: 1,
          name: &quot;beer&quot;
        },
        {
          itemId: 2,
          name: &quot;chicken&quot;
        }
      ],
      brand: &quot;Bosch&quot;,
      size: 195,
      cooler: true,
      color: &quot;grey&quot;,
      nbMax: 2
    },
    {
      _id: 2,
      items: [
        {
          itemId: 1,
          name: &quot;beer&quot;
        },
        {
          itemId: 2,
          name: &quot;chicken&quot;
        },
        {
          itemId: 3,
          name: &quot;lettuce&quot;
        }
      ],
      brand: &quot;Electrolux&quot;,
      size: 200,
      cooler: true,
      color: &quot;white&quot;,
      nbMax: 2
    },

  ]
}
</code></pre>
<p>This is my query :</p>
<pre><code>db.fridges.aggregate([
  {
    $match: {
      $and: [
        {
          &quot;brand&quot;: {
            $in: [
              &quot;Bosch&quot;,
              &quot;Electrolux&quot;
            ]
          }
        },
        {
          &quot;color&quot;: {
            $in: [
              &quot;grey&quot;,
              &quot;white&quot;
            ]
          }
        }
      ]
    }
  },
  {
    $project: {
      &quot;itemsNumber&quot;: {
        $size: {
          &quot;$filter&quot;: {
            &quot;input&quot;: &quot;$items&quot;,
            &quot;as&quot;: &quot;item&quot;,
            &quot;cond&quot;: {
              $in: [
                &quot;$$item.name&quot;,
                [
                  &quot;beer&quot;,
                  &quot;lettuce&quot;
                ]
              ]
            }
          }
        }
      },
      brand: 1,
      cooler: 1,
      color: 1,
      nbMax: 1
    }
  }
])
</code></pre>
<p>The <a href="https://mongoplayground.net/p/cNP2pdOlCXS" rel="nofollow noreferrer">runnable</a> example.</p>
<p>Which gives me this :</p>
<pre><code>[
  {
    &quot;_id&quot;: 1,
    &quot;brand&quot;: &quot;Bosch&quot;,
    &quot;color&quot;: &quot;grey&quot;,
    &quot;cooler&quot;: true,
    &quot;itemsNumber&quot;: 1,
    &quot;nbMax&quot;: 2
  },
  {
    &quot;_id&quot;: 2,
    &quot;brand&quot;: &quot;Electrolux&quot;,
    &quot;color&quot;: &quot;white&quot;,
    &quot;cooler&quot;: true,
    &quot;itemsNumber&quot;: 2,
    &quot;nbMax&quot;: 2
  }
]
</code></pre>
<p>What I expect is to keep only the results having a <code>itemsNumber</code> different from <code>nbMax</code>. In this instance, the second fridge with <code>_id:2</code> would not match the condition and should not be in returned. How can I modify my query to get this :</p>
<pre><code>[
  {
    &quot;_id&quot;: 1,
    &quot;brand&quot;: &quot;Bosch&quot;,
    &quot;color&quot;: &quot;grey&quot;,
    &quot;cooler&quot;: true,
    &quot;itemsNumber&quot;: 1,
    &quot;nbMax&quot;: 2
  }
]
</code></pre>

