Can't work out promises to return values - NodeJS<p>After searching through countless posts I don't understand why I'm still getting a Promise pending after my awaits. The code below should explain it but I'm trying to pull a MongoDB query of the max value of a column/schema. The console.log within the function is giving me the correct timestamp but I'm trying to pass that out of the inner scope and function to another function.</p>
<p>This is pure NodeJS with only MongoDB imported. Can this be done without any external packages?</p>
<pre><code>    export async function getMaxDate() {
        var time = MongoClient.connect(url, { useUnifiedTopology: true }, function (err, db) {
            if (err)
                throw err;
            var dbo = db.db(getDB);
            dbo.collection(getColl)
                .find()
                .limit(1)
                .sort({ 'timestamp': -1 })
                .toArray(function (err, result) {
                    if (err)
                        throw err;
                    time = result[0].time; // THIS IS GIVING THE CORRECT VALUE
                    console.log(time)
                    db.close();
                });

        });
        return time    
    }

    export async function getMax() {
        var block = await getMaxDate();
        return block
    } 

    var t = getMax();
    console.log(t); // THIS IS GIVE ME A PROMISE PENDING
</code></pre>

