Parse 24-char hex value in json string as BsonObjectId<p>I am trying to implement the following flow in a .NET5 Web API (rest endpoint).</p>
<ol>
<li>Receive mongodb query as json string</li>
<li>Convert json string to BsonDocument</li>
<li>Use BsonDocument to query MongoDb collection</li>
</ol>
<p>This works great as long as I do not have ObjectIds (and I guess dates) in my json query document.</p>
<p>Following examples</p>
<p>Example1</p>
<pre><code>{
  &quot;studentId&quot;: &quot;5fd627c58583b9001270e94c&quot;
}
</code></pre>
<p>Example 2</p>
<pre><code>{
  &quot;$or&quot;: [
      { &quot;cityId&quot;: &quot;5fcf975f1749910011c194f9&quot; },
      { &quot;regionId&quot;: &quot;60be5a367eeac21aebefdec4&quot; }
   ]
}
</code></pre>
<p>Obviously studentId is an ObjectId, unfortunately <code>BsonDocument.Parse(json);</code> or <code>BsonSerializer.Deserialize&lt;BsonDocument&gt;(json);</code> convert that ObjectId into BsonString instead of BsonObjectId.</p>
<p>Can someone point me into the right direction on how to achieve the auto-mapping?</p>

