How to populate mongoose virtual from another referenced model?<pre class="lang-js prettyprint-override"><code> // define a schema
  const personSchema = new Schema({
    name: {
      first: String,
      last: String
    }
  },
  {
    toJSON: {
      virtuals: true,
    },
    toObject: {
      virtuals: true,
    },
  },);
personSchema.virtual('fullName').
  get(function() {
    return this.name.first + ' ' + this.name.last;
    }).
  set(function(v) {
    this.name.first = v.substr(0, v.indexOf(' '));
    this.name.last = v.substr(v.indexOf(' ') + 1);
  });

  // compile our model
  const Person = mongoose.model('Person', personSchema);

</code></pre>
<p>This is from the docs to define <a href="https://mongoosejs.com/docs/guide.html#virtuals" rel="nofollow noreferrer">#virtuals</a></p>
