  });
const Shop = mongoose.model('Shop', shopSchema);
</code></pre>
<p>Now, how to get <code>fullName</code> virtuals on shop populate <code>owner</code>. Here, the owner doesn't include <code>fullName</code></p>
<pre class="lang-js prettyprint-override"><code>const getAllData = async () =&gt; {
