MongoDB: Query single document from multiple embedded arrays?<p>A have a collection with objects each with an array of documents, I want to query for a specific single documents across all the arrays.</p>
<p>Currently to do this I am finding the document with the array which contains the document I'm looking for, then projecting for this specific document.</p>
<p>This approach seems like an inefficient work around because:</p>
<ul>
<li>It will always iterate across all values without the ability to exit early when the desired document is found.</li>
<li>It seems as if it would be <code>O(2n)</code> since it iterates across all values for the match then all values again for the projection.</li>
<li>Returned document is awkwardly formed.</li>
</ul>
<p>Is there a better approach for this?</p>
<p>Live example: <a href="https://mongoplayground.net/p/WowuB-mZpPI" rel="nofollow noreferrer">https://mongoplayground.net/p/WowuB-mZpPI</a></p>
<pre><code>db.collection.aggregate([
  {
    &quot;$match&quot;: {
      &quot;values.name&quot;: &quot;delta&quot;
    }
  },
  {
    &quot;$project&quot;: {
      &quot;value&quot;: {
        &quot;$filter&quot;: {
          &quot;input&quot;: &quot;$values&quot;,
          &quot;cond&quot;: {
            &quot;$eq&quot;: [
              &quot;$$this.name&quot;,
              &quot;delta&quot;
            ]
          }
        }
      }
    }
  }
])
</code></pre>
<p>Example collection:</p>
<pre class="lang-json prettyprint-override"><code>[
  {
    &quot;group_name&quot;: &quot;first&quot;,
    &quot;members&quot;: [
      {
        &quot;name&quot;: &quot;alpha&quot;,
        &quot;value&quot;: 1
      },
      {
        &quot;name&quot;: &quot;beta&quot;,
        &quot;value&quot;: 2
      },
      {
        &quot;name&quot;: &quot;gamma&quot;,
        &quot;value&quot;: 3
      },

    ]
  },
  {
    &quot;group_name&quot;: &quot;second&quot;,
    &quot;values&quot;: [
      {
        &quot;name&quot;: &quot;delta&quot;,
        &quot;value&quot;: 4
      },
      {
        &quot;name&quot;: &quot;epsilon&quot;,
        &quot;value&quot;: 5
      },
      {
        &quot;name&quot;: &quot;zeta&quot;,
        &quot;value&quot;: 6
      },

    ]
  }
]
</code></pre>

